import React, { Component } from 'react';
import { Modal } from 'react-bootstrap';

// Styles
import './styles.scss';

class ContactModal extends Component {
  render() {
    const { handleClose, isModalVisible, symbol } = this.props;
    return (
      <Modal
        show={isModalVisible}
        onHide={handleClose}
        animation={true}
        className='payment-modal-style'
      >
        <Modal.Header closeButton></Modal.Header>
        <Modal.Body>
          <h6 className='madal-heading'>
            Questions or feedback for our team? We want to hear from you:
          </h6>

          <p className='description'>
            Write to us at
            <span>rohanmishra.design@gmail.com</span>
          </p>
        </Modal.Body>
      </Modal>
    );
  }
}
export default ContactModal;
